//TO DO
/*
import React from "react";
import Menu from "./Menu";
export default function Header() {
    return(
        <header>
            <div>
                <Menu/>
                <span className='logo'>Meal Planner App</span>
                <ul className='navigation'>
                    <li>About us</li>
                    <li>Contacts</li>
                    <li>Profile</li>
                </ul>
            </div>
            <div className='present'></div>
        </header>

    )
}
*/
